To improve the clarity of the stat bars, you can implement the following CSS modifications:

### CSS Improvements
1. **Segment Colors**:
   - Choose distinct colors for the base and bonus portions, ensuring good contrast between them. For example, keep the base portion a darker shade and the bonus portion a lighter, complementary color.

2. **Divider Line**:
   - Add a thin line or shadow between the segments to emphasize the separation between base and bonus.

```css
.stat-bar {
  display: flex;
  background-color: #444; /* Color for the base stat */
  border-radius: 5px;
  position: relative;
}

.stat-bar-base {
  background-color: #666; /* Darker portion for base */
  flex-basis: 50%; /* Adjust according to base value */
}

.stat-bar-bonus {
  background-color: #888; /* Lighter portion for bonus */
  flex-grow: 1; /* Adjust according to bonus value */
  margin-left: 2px; /* Divider */
}
```

### Numeric Labels
1. **Placement**:
   - **Inside the Bars**: Place numeric labels inside each segment if there's enough space. This helps users immediately see the values associated with each portion. Use a contrasting font color for readability.

   - **Outside the Bars**: If space is constrained, place labels outside the bar. Align them to the left and right of the bar for clarity.

2. **CSS for Labels**:
```css
.stat-label {
  position: absolute;
  font-size: 12px;
  color: #fff; /* Ensure good contrast */
  padding: 2px;
}

.stat-label-base {
  left: 5px; /* Position within the base portion */
}

.stat-label-bonus {
  right: 5px; /* Position within the bonus portion */
}
```

### Final Thoughts
Make sure the labels are easily readable and don't overlap with the segments. It might help to slightly increase the height of the bars for better clarity, especially if placing labels inside. This approach will make the stat bars not only functional but also visually appealing.
